import React from "react";

const Formulario = () => {
  return (
    <div className="bg-info">
      <div className="container">
        <form action="" className="col card text-white bg-transparent mb-5 pt-5 pb-2">
          <fieldset>
            <legend className="text-center"></legend>
          </fieldset>
        </form>
      </div>
    </div>
  );
}

export default Formulario;
